import React from 'react';
import styled from '@emotion/styled';
import { Col, Container, Row } from 'react-bootstrap';



export default function App() {
  const myStyle = {
    textAlign: 'center',
  }
  return (

    <>
      <Container style={myStyle}>
        <Row>
          <Col>1 of 4</Col>
          <Col>2 of 4</Col>
          <Col>3 of 4</Col>
          <Col>4 of 4</Col>
        </Row>
      </Container>
    </>
  );

};

const myStyle = {
  textAlign
}
